(4, 'GMS: Standard Operating Procedures (SOPs) against COVID-19 at HKC Compliant recycling facilities', '<p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Amid the surge in COVID-19 cases in India, the HKC compliant recycling facilities are taking absolute precautions against the spread of COVID-19. The recycling facilities and the local regulatory authorities have developed standard operating procedures to curb the spread.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">The entry and exit points in each yard are sanitized regularly. The recycling facilities are sanitized every morning before commencing activities and after completing activities in the evening. At entry and exit points, hand wash facilities along with soap are arranged. Washing of hands before entering the recycling yard is imperative. The safety officer and HSE team monitor every worker’s body temperature and ensure that workers use proper PPE &amp; masks. In work locations, social distancing is assured with strict compliance.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">During the regular breaks as well, social distancing is strictly followed. Workers are provided with masks, gloves, and adequate PPE. Safety officers supervise social distancing norms. The number of workers present in the yard at any given time is restricted to ensure adequate social distancing. If a worker is observed with any of the COVID-19 symptoms, he is transferred to the quarantine facility allotted by Gujarat Maritime Board (GMB).</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">The medical attention is provided by the Alang multi-speciality hospital. Primary Health Centre (PHC) arranges regular COVID-19 tests for the yard workers to identify any asymptomatic patient.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Similar SOPs are developed for the crews who deliver the vessels to the recycling facilities. The COVID-19 test is done for the crews onboard the vessel at anchorage. Once all the crews are tested negative, they are allowed to disembark. A crew member with symptoms is given prompt medication and treated as per the COVID-19 guidelines onshore. Crews are provided with masks and disposable protective clothing. Once the crew disembarks from the vessel, they are immediately transported to the accommodation, and they are not allowed to visit other than designated areas in the recycling facilities. A trained person sanitizes vessels’ access points and common areas before yard workers or regulatory authority representatives board the vessel.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Strict adherence to the above SOPs helps curb the spread of COVID-19 and ensures continuity in the ship recycling process without any loss of time.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Source: GMS (<a href=\"https://www.gmsinc.net/gms_new/index.php\" target=\"_blank\" rel=\"noopener\" style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px; color: rgb(1, 123, 196); transition: all 0.2s ease-in-out 0s;\">www.gmsinc.net</a>)</p>', 'uploads/newsfeed/1616041841GMS_LOGO-120x100.jpg', NULL, '2021-03-18 04:30:41', '2021-03-18 04:30:41'),
