(6, 'ENGINE: Europe & Africa Bunker Fuel Availability Outlook', '<p><span class=\"dropcap\" style=\"padding: 0px; margin: 0px 8px 0px 0px; outline: none; list-style: none; border: 0px; display: block; float: left; line-height: 50px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\"><font face=\"Georgia, Arial, helvetica neue, Helvetica, Verdana, sans-serif\"><span style=\"font-size: 50px;\">L</span></font><span style=\"font-family: Raleway; font-size: 14px;\">ow, sulphur bunker fuels are readily available in most large ports in Europe and Africa, while HSFO volumes are tight in the Canary Islands and South Africa.</span></span></p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\"></p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">A slowdown in eastward fuel oil cargo flows has left more fuel oil in storage in ARA. Independent inventories holding low and high sulphur fuel oils swelled to nine-month highs in ARA last week.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">While there has been plenty of fuel oil in storage, ARA’s bunker suppliers have had busy barge schedules and pockets of tightness for VLSFO in recent weeks.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">LSMGO has been offered in a wide price range in ARA this week, with some suppliers eager to move product. ARA ports’ LSMGO discounts to regional ports such as Skaw, Gothenburg and Hamburg have widened beyond $30/mt.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">ARA’s gasoil inventories dropped to four-month lows last week. But a pick-up in refinery runs coupled with a tentative road fuel demand recovery could eventually lead to a build-up in gasoil stocks in the hub and contribute to putting downward pressure on prices.<br style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px;\">HSFO380 stems still need to be booked 3-4 days ahead in ARA and the Gibraltar Strait ports to ensure supply. Lead times for HSFO380 stems are about twice as long in Las Palmas. Two VLSFO cargoes arrived in Las Palmas from Sweden and Spain last week, and three more are scheduled to arrive this week to replenish stocks. HSFO380 stocks are not due for replenishment until next week, sources say.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\"><a href=\"https://www.hellenicshippingnews.com/wp-content/uploads/2021/02/Europe-Africa-Fuel-Outlook.jpg\" style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px; color: rgb(1, 123, 196); transition: all 0.2s ease-in-out 0s;\"><img loading=\"lazy\" class=\"aligncenter size-full wp-image-854265\" src=\"https://www.hellenicshippingnews.com/wp-content/uploads/2021/02/Europe-Africa-Fuel-Outlook.jpg\" alt=\"\" width=\"700\" height=\"391\" srcset=\"https://www.hellenicshippingnews.com/wp-content/uploads/2021/02/Europe-Africa-Fuel-Outlook.jpg 700w, https://www.hellenicshippingnews.com/wp-content/uploads/2021/02/Europe-Africa-Fuel-Outlook-300x168.jpg 300w, https://www.hellenicshippingnews.com/wp-content/uploads/2021/02/Europe-Africa-Fuel-Outlook-600x335.jpg 600w\" sizes=\"(max-width: 700px) 100vw, 700px\" style=\"padding: 4px; margin: 2px auto; outline: none; list-style: none; border: 1px solid rgb(203, 205, 204); clear: both; max-width: 100%; height: auto; display: block;\"></a></p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">HSFO180 continues to be in short supply in Durban and Port Elizabeth. Nearly half of South Africa’s refinery capacity has been offline since an explosion and fire at two plants last year, limiting domestic production capacity of the grade. Imports have been limited to gasoil and low sulphur fuel oil, according to sources. This has sustained pressure on scarce HSFO180 supplies. VLSFO and LSMGO stems are more readily available.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Suppliers in Port Elizabeth are grappling with backlogs in the wake of last week’s weather disruptions. Strong winds and high swell disrupted bunker operations at the Algoa Bay anchorage by Port Elizabeth last week, leading to heavy delays. Deliveries are now being carried out and the weather looks calm for the coming days with the exception of a few hours of strong winds on Thursday night.<br style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px;\">Strong winds and swell hit Gibraltar Strait ports on Wednesday. Five vessels were waiting to bunker in Gibraltar in the morning, and bunkering was suspended at Algeciras’ Delta anchorage. Several suppliers are delayed by a few hours in both ports.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Rough weather has limited bunkering to one in six offshore areas off Malta at the start of the week. Intervals of strong winds are forecast over the coming days, potentially disrupting offshore bunkering in one or more of the offshore areas.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Stormy weather has hampered bunker deliveries in Russia’s Novorossiysk and Taman intermittently since last week. The weather is forecast to calm in the two Black Sea ports on Wednesday afternoon, which might open for bunkering. Strong wind gusts are forecast again for a short period in the afternoon on Thursday, before several days of calmer weather will allow suppliers to work through backlogs.</p><p style=\"padding: 0px 0px 1em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; outline: none; list-style: none; border: 0px; color: rgb(51, 51, 51); font-family: Raleway; background-color: rgb(255, 255, 255);\">Source: ENGINE (<a href=\"https://engine.online/\" target=\"_blank\" rel=\"noopener\" style=\"padding: 0px; margin: 0px; outline: none; list-style: none; border: 0px; color: rgb(1, 123, 196); transition: all 0.2s ease-in-out 0s;\">https://engine.online/</a>)</p>', 'uploads/newsfeed/1616041949ENGINE_logo_290_down-120x100.jpg', NULL, '2021-03-18 04:32:29', '2021-03-18 04:32:29');

